import React from 'react';
import Employee from "./Employee";

export default function App() {
  const employees = ["Magnus"];

  return (
    <div className="App">
      <h1>Employee list</h1>
      {employees.map((employee) => (
        <h1>{employee}</h1>
      ))}  
    </div>
  );
}
